				width 8em;
				margin: 4em auto;

				top: 0;
				left: 50%;
				height: 4em;
				width: 4em;
				margin-left: -2em;
				border: .375em solid currentColor;
				border-right-style: double;
				border-radius: 50%;
				animation: rotation .8s linear infinite;
			}

			*,
			*::before,
			*::after {
				box-sizing: inherit;
				margin: 0;
			}
			html {
				box-sizing: border-box;
				font: 100%/1.5 sans-serif;
			}
